import { useState } from 'react';
import Timeline from './timeline/Timeline';
import './Experience.css';

function Experience() {
  const [ visibility, setVisibility ] = useState(false);

  const showCard = () => {
    setVisibility(true);
  }

  return (
    <section id='experience-section' className={`full-cover centered-content ${visibility ? 'visible-section' : 'hidden-section'}`}>
      <Timeline showCard={showCard}/>
    </section>
  )
}

export default Experience;
